import NewPlayer from "./NewPlayer";

class PlayersList extends Component {
	handleNewPlayerSubmit(value) {
		console.log(value);
	}

	render() {
				const { players } = this.state;

		return 
			<Fragment>
				<h2>Playing...</h2>
					<ul>
						{ players.map((player) => (
							<li key = { player }> { player } </li>
						))}
					</ul>
			</Fragment>

	}
}

export default PlayersList;






